INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0001', , 'Hindari menggosok mata dan gunakan pelindung mata jika diperlukan untuk mencegah trauma lebih lanjut. Kompres dingin bisa membantu mengurangi rasa sakit.', 'P0001');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0002', , 'Tidak ada pengobatan rumahan spesifik penggunaan obat tetes mata yang diresepkan oleh dokter mungkin diperlukan.', 'P0002');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0003', , 'Kompres hangat selama 10 sampai 15 menit 3 sampai 4 kali sehari untuk membantu membuka saluran kelenjar yang tersumbat.', 'P0003');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0004', , 'Jaga kebersihan kelopak mata dengan membersihkannya menggunakan kapas yang dibasahi dengan air hangat dan sedikit sampo bayi atau produk pembersih mata khusus.', 'P0004');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0005', , 'Kompres hangat pada area yang terkena selama 10 sampai 15 menit 3 sampai 4 kali sehari untuk membantu mengurangi pembengkakan dan mempercepat proses penyembuhan.', 'P0005');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0006', , 'Hindari menyentuh atau menggosok mata, cuci tangan secara teratur, dan gunakan tetes mata antibiotik jika konjungtivitis bakteri', 'P0006');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0007', , 'Gunakan antibiotik sesuai resep dokter, jaga kebersihan tangan dan wajah, serta tingkatkan sanitasi lingkungan untuk mencegah penyebaran', 'P0007');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0008', , 'Segera konsultasi ke dokter mata, hindari aktivitas yang meningkatkan tekanan intraokular, dan mungkin memerlukan pembedahan darurat', 'P0008');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0009', , 'Kontrol gula darah secara ketat, lakukan pemeriksaan mata rutin, dan pertimbangkan terapi laser atau injeksi sesuai anjuran dokter', 'P0009');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0010', , 'Gunakan obat tetes mata sesuai resep, lakukan pemeriksaan mata rutin untuk memantau tekanan intraokular, dan pertimbangkan pembedahan jika diperlukan', 'P0010');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0011', , 'Gunakan kacamata atau lensa kontak jika penglihatan masih cukup baik, dan pertimbangkan operasi katarak sesuai anjuran dokter', 'P0011');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0012', , 'Gunakan obat tetes mata kortikosteroid atau anti-inflamasi sesuai resep, dan konsultasikan dengan dokter untuk penanganan lebih lanjut', 'P0012');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0013', , 'Segera konsultasi ke dokter, gunakan antibiotik intravena sesuai resep, dan mungkin memerlukan rawat inap serta penanganan lebih lanjut', 'P0013');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0014', , 'Konsultasikan dengan dokter untuk mengetahui penyebab, gunakan tetes mata pelumas untuk mencegah kekeringan, dan pertimbangkan pengobatan sesuai penyebab dasar seperti hipertiroidisme', 'P0014');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0015', , 'Gunakan tetes mata pelumas atau antibiotik sesuai resep, hindari penggunaan lensa kontak sementara, dan jaga kebersihan mata', 'P0015');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0016', , 'Hindari alergen yang memicu, gunakan tetes mata antihistamin sesuai resep, dan jaga kebersihan tangan serta mata', 'P0016');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0017', , 'Segera konsultasi ke dokter, gunakan antibiotik intravitreal sesuai resep, dan mungkin memerlukan rawat inap serta tindakan medis intensif', 'P0017');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0018', , 'Segera konsultasi ke dokter, pengobatan intensif dengan antibiotik atau antikoagulan, dan mungkin memerlukan rawat inap', 'P0018');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0019', , 'Konsultasi dengan dokter, gunakan steroid intravena sesuai resep, dan evaluasi penyebab dasar seperti multiple sclerosis', 'P0019');
INSERT INTO `tablejawaban` (`KodeJawaban`, `Gambar`, `Teks`, `KodeKerusakan`) VALUES
('J0020', , 'Gunakan kompres hangat pada area yang terkena, gunakan antibiotik sesuai resep, dan jaga kebersihan area sekitar mata serta saluran air mata', 'P0020');
